<script>
  export default {
  props: ['cities'],
  ready: function () {
    this.$watch('cities', function () {
        let len = this.cities.length

        let svg = document.querySelector('svg')
        let cities = svg.contentDocument
        for (let i = 0; i<len; i++) {
          let city = this.cities[i]

          let citySvgCircleNeutral = svg.getElementById('circle-'+city.name+'-neutral')
          let citySvgCirclePositive = svg.getElementById('circle-'+city.name+'-positive')
          let citySvgCircleNegative = svg.getElementById('circle-'+city.name+'-negative')
          let pulseNeutral = (parseFloat(city.neutral_size) + parseFloat(city.diffNeutral))*1.2
          let pulsePositive = (parseFloat(city.positive_size) + parseFloat(city.diffPositive))*1.2
          let pulseNegative = (parseFloat(city.negative_size) + parseFloat(city.diffNegative))*1.2
          pulseNeutral > 0 ? citySvgCircleNeutral.setAttribute('r', pulseNeutral) : citySvgCircleNeutral.setAttribute('r', 0)
          pulsePositive > 0 ? citySvgCirclePositive.setAttribute('r', pulsePositive) : citySvgCirclePositive.setAttribute('r', 0)
          pulseNegative > 0 ? citySvgCircleNegative.setAttribute('r', pulseNegative) : citySvgCircleNegative.setAttribute('r', 0)

          setTimeout(function(){
            citySvgCircleNeutral.setAttribute('r', city.neutral_size)
          }, 300)
          setTimeout(function(){
            citySvgCirclePositive.setAttribute('r', city.positive_size)
          }, 300)
          setTimeout(function(){
            citySvgCircleNegative.setAttribute('r', city.negative_size)
          }, 300)

          let citySvgPositive = svg.getElementById(''+city.name+'-positive')
          citySvgPositive.setAttribute('transform', 'translate('+city.x+','+city.y+')')

          let citySvgNegative = svg.getElementById(''+city.name+'-negative')
          citySvgNegative.setAttribute('transform', 'translate('+city.x+','+city.y+')')
          }
      }, {deep: true, immediate: true})
  },
  data () {
    return {
    }
  },
  methods: {
    modal: function (city) {
      this.$dispatch('passModal', city)
    }
  }
 }
</script>

